        transpile(self.circuit, self.sim_backend,
                  **{TRANSPILER_SEED_KEYWORD: self.seed})

    def setup(self, n):
        depth = 2 * n
        self.seed = 0
        self.circuit = make_circuit_ring(n, depth, self.seed)[0]
        self.sim_backend = BasicAer.get_backend('qasm_simulator')

